import React from 'react';
import styled from 'styled-components';

const StyledDiv = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-color: #282c34;
`;

const StyledH1 = styled.h1`
  color: white;
`;

function App() {
  return (
    <StyledDiv>
      <StyledH1>Hello, Intellimint!</StyledH1>
    </StyledDiv>
  );
}

export default App;
